import React, { Component } from 'react';
import TabFavorites from './favorites';
import TabDownloads from './downloads';
import TabMore from './more';
import TabItem from './tabItem';
import TabCustom from './tabCustom';

import {
  AppRegistry,
  TabBarIOS,
} from 'react-native';

/**
 * React Native Starter: TabBarIOS
 * https://github.com/joshbuchea/react-native-starter-tabbarios
 */
'use strict';


class VisionTabBarIOS extends Component {

  constructor(props) {
    super(props);
    this.state = {selectedTab: 'tabMore'};
  }

  setTab(tabId) {
    this.setState({selectedTab: tabId});
  }


  render() {

    var tabs = this.tabsList()
    return (
      <TabBarIOS>
            <TabBarIOS.Item
              selected={this.state.selectedTab === tabs[0].title}
              icon={tabs[0].icon}
              selectedIcon={tabs[0].selectedIcon}
              title={tabs[0].title}
              selectedTitle={tabs[0].title}
              onPress={() => this.setTab(tabs[0].title)}>
              <TabItem/>
            </TabBarIOS.Item>
           <TabBarIOS.Item
              selected={this.state.selectedTab === tabs[1].title}
              icon={tabs[1].icon}
              selectedIcon={tabs[1].selectedIcon}
              systemIcon={tabs[1].systemIcon}
              title={tabs[1].title}
              onPress={() => this.setTab(tabs[1].title)}>
              <TabItem/>
            </TabBarIOS.Item>
           <TabBarIOS.Item
              selected={this.state.selectedTab === tabs[2].title}
              systemIcon={tabs[2].systemIcon}
              icon={tabs[2].icon}
              selectedIcon={tabs[2].selectedIcon}
              title={tabs[2].title}
              onPress={() => this.setTab(tabs[2].title)}>
              <TabItem/>
            </TabBarIOS.Item>
          <TabBarIOS.Item
              selected={this.state.selectedTab === tabs[3].title}
              systemIcon={tabs[3].systemIcon}
              icon={tabs[3].icon}
              selectedIcon={tabs[3].selectedIcon}
              title={tabs[3].title}
              onPress={() => this.setTab(tabs[3].title)}>
              <TabCustom/>
            </TabBarIOS.Item>

      </TabBarIOS>
    );
  }

tabsList() {

  tabsJsonArray = [
          {
            icon : {
              scale: 8,
              uri: 'data:image/png;base64,'
            },
            selectedIcon : sampleIcon,
            title : "Apple",
            onPress : {}
            },
          {
            systemIcon : "downloads",
            title : "Downloads",
            onPress : {}
          },
          {
            systemIcon : "more",
            title : "More",
            onPress : {}
           },
         {
            icon : recipeIcon,
            onPress : {}
            },

  ];

    return tabsJsonArray;
}

}
const appleIcon = {
  scale: 8,
 // apple_ex
  uri: 'data:image/png;base64,'
}
const sampleIcon = {
  scale: 2.3,
  uri: 'data:image/png;base64,'
}
const recipeIcon = {
  scale: 2.3,
  uri: 'data:image/png;base64,'
}
AppRegistry.registerComponent('RNExample', () => VisionTabBarIOS);
